    static byte[] assemble(@DelegatesTo(value = CodeAssembler, strategy = Closure.DELEGATE_FIRST) Closure c) {
        CodeAssembler ca = new CodeAssembler(32)
        CodeAssemblerResult r = null

        def method = ca.class.getMethod("createLabel")
        ca.metaClass.createLabel = { ->
            def label = method.invoke(ca)
            label.metaClass.positive = { ->
                println "label $delegate"
                return r.getLabelRIP(delegate, 0)
            }
            label.metaClass.initialize()
            return label
        }

        def cmdToFixup = new IdentityHashMap()

        for (final def m in ca.class.declaredMethods) {
            boolean primitive = false
            for (final def p in m.getParameterTypes()) {
                if (p.isPrimitive()) {
                    primitive = true
                    break
                }
            }
            if (!primitive) {
                continue
            }

            Integer ii = immMap.get(m.toString())
            if (ii == null) {
                continue
            }

            def mm = m
            ca.metaClass."${mm.name}" << (new Closure(ca, ca) {
                Object call(Object... arguments) {
                    Object[] o = (Object[]) arguments
                    Object[] a = new Object[o.length];
                    for (int j = 0; j < o.length; j++) {
                        if (ii == j) {
                            a[j] = 0.asType(mm.parameterTypes[ii])
                        } else {
                            a[j] = o[j]
                        }
                    }
                    mm.invoke(ca, a)
                    cmdToFixup[ca.instructions.last()] = {
                        it.setImmediate32((int)o[ii]())
                    }
                }

                @Override
                Class[] getParameterTypes() {
                    Class[] parameterTypes = mm.parameterTypes
                    parameterTypes[ii] = Closure.class
                    return parameterTypes
                }
            })
        }
        ca.metaClass.initialize()

        def compile = { Closure cc ->
            def rr =  ca.assemble(new CodeWriter() {
                @Override
                void writeByte(byte b) {
                    cc(b)
                }
            }, 0, BlockEncoderOptions.RETURN_NEW_INSTRUCTION_OFFSETS)
            if (rr instanceof CodeAssemblerResult) {
                return rr
            }
            throw new IllegalStateException(rr)
        }

        ca.with(c)
        ca.zero_bytes()

        r = compile {}
        cmdToFixup.forEach { k, v ->
            v(k)
        }

        ByteArrayOutputStream out = new ByteArrayOutputStream()
        compile { out.write(it) }

        return out.toByteArray()
    }

